/*Table structure for table `ma_carouselimg` */

DROP TABLE IF EXISTS `ma_carouselimg`;

CREATE TABLE `ma_carouselimg` (
                                  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT COMMENT '主键id',
                                  `imgname` varchar(20) DEFAULT NULL COMMENT '名称',
                                  `imgpath` varchar(100) DEFAULT NULL COMMENT '图片路径',
                                  `imgstatus` varbinary(1) DEFAULT '0' COMMENT '图片状态 0正常 1失效',
                                  `create_by` varchar(64) DEFAULT NULL COMMENT '创建者',
                                  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
                                  `update_by` varchar(64) DEFAULT NULL COMMENT '更新者',
                                  `update_time` datetime DEFAULT NULL COMMENT '更新时间',
                                  `remark` varchar(500) DEFAULT NULL COMMENT '备注',
                                  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=10 DEFAULT CHARSET=utf8 COMMENT='轮播图';

