/*Table structure for table `ma_help` */

DROP TABLE IF EXISTS `ma_help`;

CREATE TABLE `ma_help` (
                           `hid` bigint(20) unsigned NOT NULL AUTO_INCREMENT COMMENT '记录id',
                           `husername` varchar(50) DEFAULT NULL COMMENT '求助者用户名',
                           `hname` varchar(50) DEFAULT NULL COMMENT '求助者姓名',
                           `hphone` varchar(11) DEFAULT NULL COMMENT '求助者电话',
                           `haddress` varbinary(100) DEFAULT NULL COMMENT '求助者地址',
                           `disastype` bigint(20) unsigned NOT NULL COMMENT '灾害类型',
                           `needtype` bigint(20) unsigned NOT NULL COMMENT '求助类型',
                           `status` char(1) DEFAULT '0' COMMENT '申请状态',
                           `hedusername` varchar(50) DEFAULT NULL COMMENT '提供帮助者用户名',
                           `hedname` varchar(50) DEFAULT NULL COMMENT '提供帮助者姓名',
                           `headphone` varchar(11) DEFAULT NULL COMMENT '提供帮助者电话',
                           `hedstatus` char(1) DEFAULT '0' COMMENT '帮助状态',
                           `heddetail` varchar(200) DEFAULT NULL COMMENT '详细信息',
                           `hedaddress` varchar(100) DEFAULT NULL COMMENT '提供帮助者地址',
                           `create_by` varchar(64) DEFAULT NULL COMMENT '创建者',
                           `create_time` datetime DEFAULT NULL COMMENT '创建时间',
                           `update_by` varchar(64) DEFAULT NULL COMMENT '更新者',
                           `update_time` datetime DEFAULT NULL COMMENT '更新时间',
                           `remark` varchar(500) DEFAULT NULL COMMENT '备注',
                           PRIMARY KEY (`hid`),
                           KEY `needtype` (`needtype`),
                           KEY `ma_help_ibfk_1` (`disastype`),
                           CONSTRAINT `ma_help_ibfk_1` FOREIGN KEY (`disastype`) REFERENCES `ma_distype` (`disid`),
                           CONSTRAINT `ma_help_ibfk_2` FOREIGN KEY (`needtype`) REFERENCES `ma_matype` (`maid`)
) ENGINE=InnoDB AUTO_INCREMENT=20 DEFAULT CHARSET=utf8 COMMENT='求助列表';

