/*Table structure for table `ma_material` */

DROP TABLE IF EXISTS `ma_material`;

CREATE TABLE `ma_material` (
                               `mid` bigint(20) unsigned NOT NULL AUTO_INCREMENT COMMENT 'id',
                               `mtitle` varchar(100) DEFAULT NULL COMMENT '物资标题',
                               `mtype` bigint(20) DEFAULT NULL COMMENT '物资类型',
                               `mnum` varchar(100) DEFAULT NULL COMMENT '物资数量',
                               `mdetail` varbinary(300) DEFAULT NULL COMMENT '物资详细信息',
                               `mimagid` bigint(20) unsigned NOT NULL COMMENT '图片id',
                               `maddress` varchar(100) DEFAULT NULL COMMENT '地址',
                               `mstatus` char(1) DEFAULT NULL COMMENT '物资状态（0待审核 1审核通过 2已使用）',
                               `del_flag` char(1) DEFAULT '0' COMMENT '删除标志（0正常 1删除）',
                               `create_by` varchar(64) DEFAULT NULL COMMENT '创建者',
                               `create_time` datetime DEFAULT NULL COMMENT '创建时间',
                               `update_by` varchar(64) DEFAULT NULL COMMENT '更新者',
                               `update_time` datetime DEFAULT NULL COMMENT '更新时间',
                               `remark` varchar(500) DEFAULT NULL COMMENT '备注',
                               PRIMARY KEY (`mid`),
                               KEY `mimagid` (`mimagid`)
) ENGINE=InnoDB AUTO_INCREMENT=28 DEFAULT CHARSET=utf8 COMMENT='物资列表';

