                           `ndetail` text COMMENT '新闻内容',
                           `nread` varchar(20) DEFAULT '0' COMMENT '阅读量',
                           `deltype` char(1) DEFAULT NULL COMMENT '删除标志',
                           `create_by` varchar(64) DEFAULT NULL COMMENT '创建者',
