                           PRIMARY KEY (`nid`)
) ENGINE=InnoDB AUTO_INCREMENT=6 DEFAULT CHARSET=utf8 COMMENT='新闻列表';

/*Data for the table `ma_news` */

insert  into `ma_news`(`nid`,`ntitle`,`author`,`ndetail`,`nread`,`deltype`,`create_by`,`create_time`,`update_by`,`update_time`,`remark`) values (1,'应急管理部：春节假期全国未发生重大以上灾害事故','央视网','<p>		<strong>记者从应急管理部获悉，春节假期期间，各级应急管理部门深入大型综合体、旅游景区等人员密集场所开展安全检查服务，排查消防、工贸等行业领域安全风险，督促强化雨雪降温大风天气应急准备，指导各地做好灾害事故应急救援。</strong></p><p>		<strong>截至昨天（1月27日）19时，全国安全形势总体平稳，未发生重大以上灾害事故。（总台央视记者 唐国荣）</strong></p>','21',NULL,'admin','2023-01-28 14:00:31','admin','2023-01-31 18:35:57',NULL),(2,'应急管理部发布2022年全国十大自然灾害','央视网','<p><strong>央视网消息：</strong>据应急管理部网站消息，经应急管理部会同工业和信息化部、自然资源部、住房城乡建设部、交通运输部、水利部、农业农村部、卫生健康委、统计局、气象局、银保监会、粮食和储备局、林草局、中国红十字会总会、国铁集团等部门和单位对2022年全国重大自然灾害事件会商核定，全国十大自然灾害如下(按时间排序)：</p><p><strong>一、1月8日青海门源6.9级地震</strong></p><p>1月8日1时45分，青海海北州门源县发生6.9级地震，震源深度10千米。震中位于青海、甘肃两省交界处，此后又发生5.1级、5.2 级强余震，地震共造成青海、甘肃、内蒙古、宁夏4省(区)17.1万人受灾，不同程度损坏房屋9.5万间，局地交通、市政等基础设施受损严重，直接经济损失32.5亿元。</p><p><strong>二、2月中下旬南方低温雨雪冰冻灾害</strong></p><p>2月中下旬，南方出现大范围低温雨雪冰冻灾害过程，持续时间长，暴雪落区偏南，降水(雪)强度大。持续低温雨雪冰冻对农业生产、交通、电力等造成一定影响。灾害造成福建、江西、湖南、广东、广西等9省(区、市)77个市447个县(市、区)609.2万人受灾，近8400人紧急转移安置；农作物受灾面积422.3千公顷；900余间房屋倒塌，近6500间不同程度损坏；直接经济损失78.9亿元。</p><p><strong>三、6月上中旬珠江流域暴雨洪涝灾害</strong></p><p>5月下旬至6月上中旬，我国华南地区遭遇1961年以来第2强的“龙舟水”过程。受其影响，珠江流域连续形成2次流域性较大洪水，北江出现1915年以来最大洪水，西江、北江、韩江先后发生7次编号洪水，局地发生严重城乡内涝和山洪地质灾害等。灾害造成广东、广西2省(区)648.9万人次受灾，因灾死亡失踪37人，紧急转移安置50.2万人次；倒塌房屋9200余间，不同程度损坏2.4万间；农作物受灾面积288.4千公顷；直接经济损失278.2亿元。</p><p><strong>四、6月份闽赣湘三省暴雨洪涝灾害</strong></p><p>6月份，福建、江西、湖南多地遭遇多轮强降雨过程，累计雨量大、降雨落区重叠、受灾范围广，多条河流发生超历史洪水，引发洪涝和次生地质灾害等，农业、水利、交通、供水、供电等基础设施受损严重。灾害造成福建、江西、湖南3省814.2万人次受灾，因灾死亡失踪29人，紧急转移安置62.9万人次；倒塌房屋9100余间，不同程度损坏5万余间；农作物受灾面积582千公顷；直接经济损失433亿元。</p><p><strong>五、2022年第3号台风“暹芭”</strong></p><p>2022年第3号台风“暹芭”于7月2日15时左右在广东电白沿海登陆(台风级，35米/秒)。登陆后穿过广东、广西、湖南3省(区)，其残余环流继续北上影响我国黄淮、东北等地。造成广东、广西、海南等省(区)39个市165个县(市、区)186.29万人受灾，紧急转移安置7万余人；倒塌房屋670余间，不同程度损坏近1400间；农作物受灾面积109.01千公顷；直接经济损失31.2亿元。</p><p><strong>六、7月中旬四川暴雨洪涝灾害</strong></p><p>7月11日至17日，四川省部分地区遭受多轮强降雨天气，部分地区降暴雨，局地大暴雨，并伴有雷电、阵性大风等强对流天气，引发山洪、泥石流等灾害。造成绵阳、阿坝、雅安等13市(州)76个县(市、区)27.9万人受灾，因灾死亡失踪36人，紧急转移安置1.4万人；倒塌房屋近400间，不同程度损坏近2200间；农作物受灾面积3.9千公顷；直接经济损失24.8亿元。</p><p><strong>七、长江流域夏秋冬连旱</strong></p><p>7月至11月上半月，长江流域降水异常偏少、极端高温天气持续，中旱以上日数为77天，较常年同期偏多54天，为有完整实测资料以来最严重的气象水文干旱，极端高温干旱对相关地区农业生产、人畜饮水、电力供应、生态环境等造成严重影响。旱情峰值时，造成四川、重庆、湖北、湖南、江西等12省(区、市)3978万人受灾，701.4万人因旱需生活救助；农作物受灾面积4270千公顷；直接经济损失408.5亿元。</p><p><strong>八、8月上旬辽宁暴雨洪涝灾害</strong></p><p>7月底至8月上旬，辽宁省中西部、东南部等地出现暴雨到大暴雨，引发洪涝灾害，辽河干流持续超警，支流绕阳河堤防发生决口险情，农业、基础设施等损失较重。灾害造成锦州、阜新、盘锦等9市31个县(市、区)54.9万人受灾，紧急转移安置3.4万人；倒塌房屋100余间，不同程度损坏8500余间；农作物受灾面积166.4千公顷；直接经济损失76亿元。</p><p><strong>九、8月17日青海大通山洪灾害</strong></p><p>8月17日22时许，受持续强降雨影响，青海省多地发生暴雨洪涝灾害，西宁市大通县青林乡、青山乡等地瞬时强降雨引发山洪，道路、桥梁、水利等基础设施受损严重。灾害共造成西宁、海北、海东、黄南、果洛5市(州)11个县(市、区)6.5万人受灾，因灾死亡失踪31人，紧急转移安置3300余人；倒塌房屋100余间，不同程度损坏9000余间；农作物受灾面积5.3千公顷；直接经济损失6.9亿元。</p><p><strong>十、9月5日四川泸定6.8级地震</strong></p><p>9月5日12时52分，四川省甘孜藏族自治州泸定县发生6.8级地震，震源深度16公里。地震造成四川省甘孜、雅安等6市(州)24个县(市、区)54.8万人受灾，因灾死亡失踪117人，紧急转移安置8万人；倒塌房屋1.2万间，不同程度损坏26.5万间；灾区居民住房及电力、通信、道路等基础设施损毁严重，直接经济损失154.8亿元。</p>','4',NULL,'admin','2023-01-28 14:14:25','admin','2023-01-31 18:36:01',NULL),(3,'应急管理部调度四川泸定5.6级地震 暂无人员伤亡和房屋倒塌','应急管理部官网','<p>	1月26日3时49分，四川甘孜州泸定县（北纬29.63度，东经102.01度）发生5.6级地震，震源深度11千米。&nbsp;</p><p>	地震发生后， 应急管理部第一时间调度， 国务院抗震救灾指挥部副指挥长、 应急管理部部长王祥喜立即作出部署，徐加爱、徐平、琼色等部领导调度了解情况，指导做好抢险救援和灾情巡查核查工作。&nbsp;</p><p>	地震发生后，四川消防救援总队调派雅安、甘孜支队184人、34车、3犬、5艇到场开展灾情排查和人员搜救工作，调派成都、乐山、眉山、自贡等地救援队伍880人、217车、26犬集结待命；四川森林消防总队调派甘孜支队100人、22车、3犬到场搜救排查，攀枝花、阿坝、凉山支队、特勤大队616人集结待命。四川省应急管理厅派出工作组赶赴震中，甘孜州已启动地震四级应急响应。&nbsp;</p><p>	目前，震中及周边乡镇交通、通信、电力正常，截至26日上午10时，暂未接到人员伤亡、房屋倒塌和财产损失情况报告</p><p>		</p>','2',NULL,'admin','2023-01-28 18:21:48','admin','2023-01-29 11:51:45',NULL),(4,'国家减灾中心全面掀起学习贯彻 党的二十大精神热潮','国家减灾网','<p class=\"ql-align-justify\">	连日来，国家减灾中心党委采取党委（扩大）会、党支部和党小组集中学习等方式，组织学习党的二十大精神，研究贯彻落实措施，迅速掀起学习贯彻党的二十大精神热潮。</p><p class=\"ql-align-justify\">	根据减灾中心党委要求，10月16日减灾中心全体党员和干部职工通过电视、网络等方式，收听收看大会盛况。10月25日、28日、31日，减灾中心党委集中组织召开党委（扩大）会，传达学习党的二十大和二十届一中全会精神，研究贯彻落实工作方案，审议通过《减灾中心党委学习贯彻落实党的二十大精神工作方案》。</p><p class=\"ql-align-justify\">	减灾中心党委强调，学习宣传贯彻党的二十大精神是当前和今后一个时期的首要政治任务。<strong>要</strong>把学习贯彻党的二十大精神同学习党的十八大、十九大报告及习近平总书记系列讲话结合起来，同习近平总书记授旗致训词四周年集中学习宣贯活动结合起来，同习近平总书记关于应急管理和防灾减灾救灾重要论述结合起来，同谋划下一步重点工作结合起来，坚定不移把党的二十大提出的目标任务落到实处；<strong>要</strong>充分发挥党委理论学习中心组示范带动作用，党员领导干部带头领学促学，讲体会、谈感受，全体党员干部全面、系统、深入学；<strong>要</strong>创新学习形式，采取专家解读、主题党日、学习研讨和经验交流等灵活多样的形式，营造浓厚的学习氛围，确保覆盖到每个党支部、每个党小组、每名党员干部职工；<strong>要</strong>坚持学以致用，深入领会国家应急管理体系、完善风险监测预警体系、推动公共安全治理模式向事前预防转型、提高防灾减灾救灾和重大突发公共事件处置保障能力的重要意义，结合减灾中心业务工作实际加快推进 “两中心一库”建设。</p><p class=\"ql-align-justify\">	各党支部、党小组组织党员干部积极开展集中学习，结合工作实际谈认识谈思考，讨论研究如何将大会确定的重要思想、重要观点、重大判断、重大部署在应急管理和防灾减灾救灾领域具体化、实践化，不断提升防灾减灾救灾处置和技术服务保障能力。党员干部纷纷表示，作为一名应急领域的防灾减灾人，要把学习成果转化为干事创业、艰苦奋斗的强大动力，坚决扛起防范化解重大安全风险的政治责任，自信自强、守正创新，踔厉奋发、勇毅前行，为应急管理和防灾减灾救灾事业高质量发展贡献力量。</p><p><br></p>','6',NULL,'admin','2023-01-28 18:22:29','admin','2023-02-08 18:09:36',NULL),(5,'应急减灾二号SAR卫星成功发射','国家减灾网','<p>	10月13日6时53分，在第33个国际减灾日，我国在太原卫星发射中心用长征二号丙运载火箭，成功发射应急减灾二号SAR卫星。</p><p class=\"ql-align-center\">	<img src=\"https://www.ndrcc.org.cn/u/cms/www/202210/13082254hg06.png\" alt=\"image.png\"></p><p>	</p><p>	该星是《国家民用空间基础设施中长期发展规划（2015-2025年）》支持立项的遥感业务星，作为2012年发射的环境减灾一号C星的后续业务卫星，可为应急管理业务提供持续、稳定的合成孔径雷达数据。</p><p>	应急减灾二号SAR卫星搭载S频段多极化合成孔径雷达，具备全天时、全天候成像能力，可不受光照条件及云雨雾等恶劣气象条件影响，提供5米、25米空间分辨率卫星遥感数据，为洪涝、地震、滑坡、泥石流等灾害监测提供数据支撑。该星还搭载了星上应急处理器，可在轨完成灾害区域实时成像、数据处理、水体提取，提升灾害应急响应速度，增强产品服务效能。</p><p>	应急减灾二号SAR卫星的成功发射，丰富了应急卫星遥感数据获取类型，完善了我国应急卫星遥感监测网络，与在轨运行的应急减灾二号A、B星组网，稳步提升了面向灾害事故监测的光学、SAR等卫星遥感数据快速获取能力。</p><p>	应急管理部国家减灾中心（应急管理部卫星减灾应用中心）作为应急减灾二号SAR卫星工程项目法人单位，开展了项目的前期工作和建设管理工作，研发了卫星运管、防灾减灾与应急管理卫星应用系统。后续，国家减灾中心将会同卫星工程相关单位，开展应急减灾二号SAR卫星在轨测试工作，按照边测试、边应用的原则，逐步完善相关应用体系，切实提升卫星遥感技术在应急管理领域的业务支撑能力。</p>','15',NULL,'admin','2023-01-28 18:23:07','admin','2023-02-08 17:27:42',NULL);

/*Table structure for table `ma_user` */

DROP TABLE IF EXISTS `ma_user`;

CREATE TABLE `ma_user` (
                           `userid` bigint(20) unsigned NOT NULL AUTO_INCREMENT COMMENT '账号ID',
                           `username` varchar(32) NOT NULL COMMENT '用户名',
                           `name` varchar(32) DEFAULT NULL COMMENT '姓名',
                           `password` varchar(100) NOT NULL COMMENT '密码',
                           `usertype` varchar(2) DEFAULT NULL COMMENT '账号类型',
                           `sex` char(1) DEFAULT '0' COMMENT '性别 0男 1女 2未知',
                           `phone` varchar(11) DEFAULT NULL COMMENT '手机号',
                           `email` varchar(32) DEFAULT NULL COMMENT '用户邮箱',
                           `address` varchar(32) DEFAULT NULL COMMENT '用户地址',
                           `logindata` datetime DEFAULT NULL COMMENT '最后登录时间',
                           `status` char(1) DEFAULT '0' COMMENT '账号状态 0正常 1停用',
                           `avatar` varchar(100) DEFAULT '' COMMENT '头像',
                           `del_flag` char(1) DEFAULT '0' COMMENT '删除标志 0正常 1删除',
                           `create_by` varchar(64) DEFAULT NULL COMMENT '创建者',
                           `create_time` datetime DEFAULT NULL COMMENT '创建时间',
                           `update_by` varchar(64) DEFAULT NULL COMMENT '更新者',
                           `update_time` datetime DEFAULT NULL COMMENT '更新时间',
                           `remark` varchar(500) DEFAULT NULL COMMENT '备注',
                           PRIMARY KEY (`userid`)
) ENGINE=InnoDB AUTO_INCREMENT=6 DEFAULT CHARSET=utf8;

/*Data for the table `ma_user` */

