":\"ma:mews:list\",\"status\":\"0\",\"updateBy\":\"admin\",\"visible\":\"0\"}','{\"msg\":\"操作成功\",\"code\":200}',0,NULL,'2023-01-28 13:24:57'),(411,'新闻列',1,'com.ruoyi.material.controller.MaNewsController.add()','POST',1,'admin',NULL,'/ma/news','127.0.0.1','内网IP','{\"author\":\"春节假期全国未发生重大以上灾害事故\",\"createTime\":\"2023-01-28 14:00:31.288\",\"ndetail\":\"<p>\\t\\t<strong>记者从应急管理部获悉，春节假期期间，各级应急管理部门深入大型综合体、旅游景区等人员密集场所开展安全检查服务，排查消防、工贸等行业领域安全风险，督促强化雨雪降温大风天气应急准备，指导各地做好灾害事故应急救援。</strong></p><p>\\t\\t<strong>截至昨天（1月27日）19时，全国安全形势总体平稳，未发生重大以上灾害事故。（总台央视记者 唐国荣）</strong></p>\",\"ntitile\":\"应急管理部：春节假期全国未发生重大以上灾害事故\",\"params\":{}}','{\"msg\":\"操作成功\",\"code\":200}',0,NULL,'2023-01-28 14:00:31'),(412,'新闻列',2,'com.ruoyi.material.controller.MaNewsController.edit()','PUT',1,'admin',NULL,'/ma/news','127.0.0.1','内网IP','{\"author\":\"春节假期全国未发生重大以上灾害事故\",\"createTime\":\"2023-01-28 14:00:31\",\"ndetail\":\"<p>\\t\\t<strong>记者从应急管理部获悉，春节假期期间，各级应急管理部门深入大型综合体、旅游景区等人员密集场所开展安全检查服务，排查消防、工贸等行业领域安全风险，督促强化雨雪降温大风天气应急准备，指导各地做好灾害事故应急救援。</strong></p><p>\\t\\t<strong>截至昨天（1月27日）19时，全国安全形势总体平稳，未发生重大以上灾害事故。（总台央视记者 唐国荣）</strong></p>\",\"nid\":1,\"nread\":\"0\",\"ntitile\":\"应急管理部：春节假期全国未发生重大以上灾害事故\",\"params\":{},\"updateBy\":\"admin\",\"updateTime\":\"2023-01-28 14:11:40.415\"}','{\"msg\":\"操作成功\",\"code\":200}',0,NULL,'2023-01-28 14:11:40'),(413,'新闻列',2,'com.ruoyi.material.controller.MaNewsController.edit()','PUT',1,'admin',NULL,'/ma/news','127.0.0.1','内网IP','{\"author\":\"央视网\",\"createTime\":\"2023-01-28 14:00:31\",\"ndetail\":\"<p>\\t\\t<strong>记者从应急管理部获悉，春节假期期间，各级应急管理部门深入大型综合体、旅游景区等人员密集场所开展安全检查服务，排查消防、工贸等行业领域安全风险，督促强化雨雪降温大风天气应急准备，指导各地做好灾害事故应急救援。</strong></p><p>\\t\\t<strong>截至昨天（1月27日）19时，全国安全形势总体平稳，未发生重大以上灾害事故。（总台央视记者 唐国荣）</strong></p>\",\"nid\":1,\"nread\":\"0\",\"ntitile\":\"应急管理部：春节假期全国未发生重大以上灾害事故\",\"params\":{},\"updateBy\":\"admin\",\"updateTime\":\"2023-01-28 14:11:54.115\"}','{\"msg\":\"操作成功\",\"code\":200}',0,NULL,'2023-01-28 14:11:54'),(414,'新闻列',1,'com.ruoyi.material.controller.MaNewsController.add()','POST',1,'admin',NULL,'/ma/news','127.0.0.1','内网IP','{\"author\":\"央视网\",\"createBy\":\"admin\",\"createTime\":\"2023-01-28 14:14:24.618\",\"ndetail\":\"<p><strong>央视网消息：</strong>据应急管理部网站消息，经应急管理部会同工业和信息化部、自然资源部、住房城乡建设部、交通运输部、水利部、农业农村部、卫生健康委、统计局、气象局、银保监会、粮食和储备局、林草局、中国红十字会总会、国铁集团等部门和单位对2022年全国重大自然灾害事件会商核定，全国十大自然灾害如下(按时间排序)：</p><p><strong>一、1月8日青海门源6.9级地震</strong></p><p>1月8日1时45分，青海海北州门源县发生6.9级地震，震源深度10千米。震中位于青海、甘肃两省交界处，此后又发生5.1级、5.2 级强余震，地震共造成青海、甘肃、内蒙古、宁夏4省(区)17.1万人受灾，不同程度损坏房屋9.5万间，局地交通、市政等基础设施受损严重，直接经济损失32.5亿元。</p><p><strong>二、2月中下旬南方低温雨雪冰冻灾害</strong></p><p>2月中下旬，南方出现大范围低温雨雪冰冻灾害过程，持续时间长，暴雪落区偏南，降水(雪)强度大。持续低温雨雪冰冻对农业生产、交通、电力等造成一定影响。灾害造成福建、江西、湖南、广东、广西等9省(区、市)77个市447个县(市、区)609.2万人受灾，近8400人紧急转移安置；农作物受灾面积422.3千公顷；900余间房屋倒塌，近6500间不同程度损坏；直接经济损失78.9亿元。</p><p><strong>三、6月上中旬珠江流域暴雨洪涝灾害</strong></p><p>5月下旬至6月上中旬，我国华南地区遭遇1961年以来第2强的“龙舟水”过程。受其影响，珠江流域连续形成2次流域性较大洪水，北江出现1915年以来最大洪水，西江、北江、韩江先后发生7次编号洪水，局地发生严重城乡内涝和山洪地质灾害等。灾害造成广东、广西2省(区)648.9万人次受灾，因灾死亡失踪37人，紧急转移安置50.2万人次；倒塌房屋9200余间，不同程度损坏2.4万间；农作物受灾面积288.4千公顷；直接经济损失278.2亿元。</p><p><strong>四、6月份闽赣湘三省暴雨洪涝灾害</strong></p><p>6月份，福建、江西、湖南多地遭遇多轮强降雨过程，累计雨量大、降雨落区重叠、受灾范围广，多条河流发生超历史洪水，引发洪涝和次生地质灾害等，农业、水利、交通、供水、供电等基础设施受损严重。灾害造成福建、江西、湖南3省814.2万人次受灾，因灾死亡失踪29人，紧急转移安置62.9万人次；倒塌房屋9100余间，不同程度损坏5万余间；农作物受灾面积582千公顷；直接经济损失433亿元。</p><p><strong>五、2022年第3号台风“暹芭”</strong></p><p>2022年第3号台风“暹芭”于7月2日15时左右在广东电白沿海登陆(台风级，35米/秒)。登陆后穿过广东、广西、湖南3省(区)，其残余环流继续北上影响我国黄淮、东北等地。造成广东、广西、海南等省(区)39个市165个县(市、区)186.29万人受灾，紧急转移安置7万余人；倒塌房屋670余间，不同程度损坏近1400间；农作物受灾面积109.01千公顷；直接经济损失31.2亿元。</p><p><strong>六、7月中旬四川暴雨洪涝灾害</strong></p><p>7月11日至17日，四川省部分地区遭受多轮强降雨天气，部分地区降暴雨，局地大暴雨，并伴有雷电、阵性大风等强对流天气，引发山洪、泥石流等灾害。造成绵阳、阿坝、雅安等13市(州)76个县(市、区)27.9万人受灾，因灾死亡失踪36人，紧急转移安置1.4万人；倒塌房屋近400间，不同程度损坏近2200间；农作物受灾面积3.9千公顷；直接经济损失24.8亿元。</p><p><strong>七、长江流域夏秋冬连旱</strong></p><p>7月至11月上半月，长江流域降水异常偏少、极端高温天气持续，中旱以上日数为77天，较常年同期偏多54天，为有完整实测资料以来最严重的气象水文干旱，极端高温干旱对相关地区农业生产、人畜饮水、电力供应、生态环境等造成严重影响。旱情峰值时，造成四川、重庆、湖北、湖南、江西等12省(区、市)3978万人受灾，701.4万人因旱需生活救助；农作物受灾面积4270千公顷；直接经济损失408.5亿元。</p><p><strong>八、8月上旬辽宁暴雨洪涝灾害</strong></p><p>7月底至8月上旬，辽宁省中西部、东南部等地出现暴雨到大暴雨，引发洪涝灾害，辽河干流持续超警，支流绕阳河堤防发生决口险情，农业、基础设施等损失较重。灾害','{\"msg\":\"操作成功\",\"code\":200}',0,NULL,'2023-01-28 14:14:24'),(415,'新闻列',2,'com.ruoyi.material.controller.MaNewsController.edit()','PUT',1,'admin',NULL,'/ma/news','127.0.0.1','内网IP','{\"nid\":1,\"nread\":\"01\",\"params\":{},\"updateBy\":\"admin\",\"updateTime\":\"2023-01-28 16:52:39.629\"}','{\"msg\":\"操作成功\",\"code\":200}',0,NULL,'2023-01-28 16:52:39'),(416,'新闻列',2,'com.ruoyi.material.controller.MaNewsController.edit()','PUT',1,'admin',NULL,'/ma/news','127.0.0.1','内网IP','{\"nid\":1,\"nread\":\"2\",\"params\":{},\"updateBy\":\"admin\",\"updateTime\":\"2023-01-28 16:54:30.603\"}','{\"msg\":\"操作成功\",\"code\":200}',0,NULL,'2023-01-28 16:54:30'),(417,'新闻列',2,'com.ruoyi.material.controller.MaNewsController.edit()','PUT',1,'admin',NULL,'/ma/news','127.0.0.1','内网IP','{\"nid\":1,\"nread\":\"3\",\"params\":{},\"updateBy\":\"admin\",\"updateTime\":\"2023-01-28 17:08:38.186\"}','{\"msg\":\"操作成功\",\"code\":200}',0,NULL,'2023-01-28 17:08:38'),(418,'新闻列',2,'com.ruoyi.material.controller.MaNewsController.edit()','PUT',1,'admin',NULL,'/ma/news','127.0.0.1','内网IP','{\"nid\":1,\"nread\":\"3\",\"params\":{},\"updateBy\":\"admin\",\"updateTime\":\"2023-01-28 17:08:47.815\"}','{\"msg\":\"操作成功\",\"code\":200}',0,NULL,'2023-01-28 17:08:47'),(419,'新闻列',2,'com.ruoyi.material.controller.MaNewsController.edit()','PUT',1,'admin',NULL,'/ma/news','127.0.0.1','内网IP','{\"nid\":1,\"nread\":\"3\",\"params\":{},\"updateBy\":\"admin\",\"updateTime\":\"2023-01-28 17:09:16.667\"}','{\"msg\":\"操作成功\",\"code\":200}',0,NULL,'2023-01-28 17:09:16'),(420,'新闻列',2,'com.ruoyi.material.controller.MaNewsController.edit()','PUT',1,'admin',NULL,'/ma/news','127.0.0.1','内网IP','{\"nid\":1,\"nread\":\"4\",\"params\":{},\"updateBy\":\"admin\",\"updateTime\":\"2023-01-28 17:09:22.895\"}','{\"msg\":\"操作成功\",\"code\":200}',0,NULL,'2023-01-28 17:09:22'),(421,'新闻列',2,'com.ruoyi.material.controller.MaNewsController.edit()','PUT',1,'admin'