e\":\"2023-01-28 17:48:53.093\"}','{\"msg\":\"操作成功\",\"code\":200}',0,NULL,'2023-01-28 17:48:53'),(442,'新闻列',2,'com.ruoyi.material.controller.MaNewsController.edit()','PUT',1,'admin',NULL,'/ma/news','127.0.0.1','内网IP','{\"nid\":2,\"nread\":\"2\",\"params\":{},\"updateBy\":\"admin\",\"updateTime\":\"2023-01-28 17:49:23.077\"}','{\"msg\":\"操作成功\",\"code\":200}',0,NULL,'2023-01-28 17:49:23'),(443,'新闻列',2,'com.ruoyi.material.controller.MaNewsController.edit()','PUT',1,'admin',NULL,'/ma/news','127.0.0.1','内网IP','{\"nid\":1,\"nread\":\"19\",\"params\":{},\"updateBy\":\"admin\",\"updateTime\":\"2023-01-28 17:49:42.022\"}','{\"msg\":\"操作成功\",\"code\":200}',0,NULL,'2023-01-28 17:49:42'),(444,'新闻列',2,'com.ruoyi.material.controller.MaNewsController.edit()','PUT',1,'admin',NULL,'/ma/news','127.0.0.1','内网IP','{\"nid\":2,\"nread\":\"2\",\"params\":{},\"updateBy\":\"admin\",\"updateTime\":\"2023-01-28 17:49:45.465\"}','{\"msg\":\"操作成功\",\"code\":200}',0,NULL,'2023-01-28 17:49:45'),(445,'通知公告',1,'com.ruoyi.web.controller.system.SysNoticeController.add()','POST',1,'admin',NULL,'/system/notice','127.0.0.1','内网IP','{\"createBy\":\"admin\",\"noticeContent\":\"<p>新版本正式上线，欢迎使用！</p>\",\"noticeTitle\":\"新版本上线了\",\"noticeType\":\"2\",\"params\":{},\"status\":\"0\"}','{\"msg\":\"操作成功\",\"code\":200}',0,NULL,'2023-01-28 17:56:57'),(446,'新闻列',2,'com.ruoyi.material.controller.MaNewsController.edit()','PUT',1,'admin',NULL,'/ma/news','127.0.0.1','内网IP','{\"nid\":1,\"nread\":\"20\",\"params\":{},\"updateBy\":\"admin\",\"updateTime\":\"2023-01-28 18:19:33.785\"}','{\"msg\":\"操作成功\",\"code\":200}',0,NULL,'2023-01-28 18:19:33'),(447,'新闻列',1,'com.ruoyi.material.controller.MaNewsController.add()','POST',1,'admin',NULL,'/ma/news','127.0.0.1','内网IP','{\"author\":\"应急管理部官网\",\"createBy\":\"admin\",\"createTime\":\"2023-01-28 18:21:47.611\",\"ndetail\":\"<p>\\t1月26日3时49分，四川甘孜州泸定县（北纬29.63度，东经102.01度）发生5.6级地震，震源深度11千米。&nbsp;</p><p>\\t地震发生后， 应急管理部第一时间调度， 国务院抗震救灾指挥部副指挥长、 应急管理部部长王祥喜立即作出部署，徐加爱、徐平、琼色等部领导调度了解情况，指导做好抢险救援和灾情巡查核查工作。&nbsp;</p><p>\\t地震发生后，四川消防救援总队调派雅安、甘孜支队184人、34车、3犬、5艇到场开展灾情排查和人员搜救工作，调派成都、乐山、眉山、自贡等地救援队伍880人、217车、26犬集结待命；四川森林消防总队调派甘孜支队100人、22车、3犬到场搜救排查，攀枝花、阿坝、凉山支队、特勤大队616人集结待命。四川省应急管理厅派出工作组赶赴震中，甘孜州已启动地震四级应急响应。&nbsp;</p><p>\\t目前，震中及周边乡镇交通、通信、电力正常，截至26日上午10时，暂未接到人员伤亡、房屋倒塌和财产损失情况报告</p><p>\\t\\t</p>\",\"ntitle\":\"应急管理部调度四川泸定5.6级地震 暂无人员伤亡和房屋倒塌\",\"params\":{}}','{\"msg\":\"操作成功\",\"code\":200}',0,NULL,'2023-01-28 18:21:47'),(448,'新闻列',1,'com.ruoyi.material.controller.MaNewsController.add()','POST',1,'admin',NULL,'/ma/news','127.0.0.1','内网IP','{\"author\":\"国家减灾网\",\"createBy\":\"admin\",\"createTime\":\"2023-01-28 18:22:28.82\",\"ndetail\":\"<p class=\\\"ql-align-justify\\\">\\t连日来，国家减灾中心党委采取党委（扩大）会、党支部和党小组集中学习等方式，组织学习党的二十大精神，研究贯彻落实措施，迅速掀起学习贯彻党的二十大精神热潮。</p><p class=\\\"ql-align-justify\\\">\\t根据减灾中心党委要求，10月16日减灾中心全体党员和干部职工通过电视、网络等方式，收听收看大会盛况。10月25日、28日、31日，减灾中心党委集中组织召开党委（扩大）会，传达学习党的二十大和二十届一中全会精神，研究贯彻落实工作方案，审议通过《减灾中心党委学习贯彻落实党的二十大精神工作方案》。</p><p class=\\\"ql-align-justify\\\">\\t减灾中心党委强调，学习宣传贯彻党的二十大精神是当前和今后一个时期的首要政治任务。<strong>要</strong>把学习贯彻党的二十大精神同学习党的十八大、十九大报告及习近平总书记系列讲话结合起来，同习近平总书记授旗致训词四周年集中学习宣贯活动结合起来，同习近平总书记关于应急管理和防灾减灾救灾重要论述结合起来，同谋划下一步重点工作结合起来，坚定不移把党的二十大提出的目标任务落到实处；<strong>要</strong>充分发挥党委理论学习中心组示范带动作用，党员领导干部带头领学促学，讲体会、谈感受，全体党员干部全面、系统、深入学；<strong>要</strong>创新学习形式，采取专家解读、主题党日、学习研讨和经验交流等灵活多样的形式，营造浓厚的学习氛围，确保覆盖到每个党支部、每个党小组、每名党员干部职工；<strong>要</strong>坚持学以致用，深入领会国家应急管理体系、完善风险监测预警体系、推动公共安全治理模式向事前预防转型、提高防灾减灾救灾和重大突发公共事件处置保障能力的重要意义，结合减灾中心业务工作实际加快推进 “两中心一库”建设。</p><p class=\\\"ql-align-justify\\\">\\t各党支部、党小组组织党员干部积极开展集中学习，结合工作实际谈认识谈思考，讨论研究如何将大会确定的重要思想、重要观点、重大判断、重大部署在应急管理和防灾减灾救灾领域具体化、实践化，不断提升防灾减灾救灾处置和技术服务保障能力。党员干部纷纷表示，作为一名应急领域的防灾减灾人，要把学习成果转化为干事创业、艰苦奋斗的强大动力，坚决扛起防范化解重大安全风险的政治责任，自信自强、守正创新，踔厉奋发、勇毅前行，为应急管理和防灾减灾救灾事业高质量发展贡献力量。</p><p><br></p>\",\"ntitle\":\"国家减灾中心全面掀起学习贯彻 党的二十大精神热潮\",\"params\":{}}','{\"msg\":\"操作成功\",\"code\":200}',0,NULL,'2023-01-28 18:22:28'),(449,'新闻列',1,'com.ruoyi.material.controller.MaNewsController.add()','POST',1,'admin',NULL,'/ma/news','127.0.0.1','内网IP','{\"author\":\"国家减灾网\",\"createBy\":\"admin\",\"createTime\":\"2023-01-28 18:23:07.246\",\"ndetail\":\"<p>\\t10月13日6时53分，在第33个国际减灾日，我国在太原卫星发射中心用长征二号丙运载火箭，成功发射应急减灾二号SAR卫星。</p><p class=\\\"ql-align-center\\\">\\t<img src=\\\"https://www.ndrcc.org.cn/u/cms/www/202210/13082254hg06.png\\\" alt=\\\"image.png\\\"></p><p>\\t</p><p>\\t该星是《国家民用空间基础设施中长期发展规划（2015-2025年）》支持立项的遥感业务星，作为2012年发射的环境减灾一号C星的后续业务卫星，可为应急管理业务提供持续、稳定的合成孔径雷达数据。</p><p>\\t应急减灾二号SAR卫星搭载S频段多极化合成孔径雷达，具备全天时、全天候成像能力，可不受光照条件及云雨雾等恶劣气象条件影响，提供5米、25米空间分辨率卫星遥感数据，为洪涝、地震、滑坡、泥石流等灾害监测提供数据支撑。该星还搭载了星上应急处理器，可在轨完成灾害区域实时成像、数据处理、水体提取，提升灾害应急响应速度，增强产品服务效能。</p><p>\\t应急减灾二号SAR卫星的成功发射，丰富了应急卫星遥感数据获取类型，完善了我国应急卫星遥感监测网络，与在轨运行的应急减灾二号A、B星组网，稳步提升了面向灾害事故监测的光学、SAR等卫星遥感数据快速获取能力。</p><p>\\t应急管理部国家减灾中心（应急管理部卫星减灾应用中心）作为应急减灾二号SAR卫星工程项目法人单位，开展了项目的前期工作和建设管理工作，研发了卫星运管、防灾减灾与应急管理卫星应用系统。后续，国家减灾中心将会同卫星工程相关单位，开展应急减灾二号SAR卫星在轨测试工作，按照边测试、边应用的原则，逐步完善相关应用体系，切实提升卫星遥感技术在应急管理领域的业务支撑能力。</p>\",\"ntitle\":\"应急减灾二号SAR卫星成功发射\",\"params\":{}}','{\"msg\":\"操作成功\",\"code\":200}',0,NULL,'2023-01-28 18:23:07'),(450,'新闻列',2,'com.ruoyi.material.controller.MaNewsController.edit()','PUT',1,'admin',NULL,'/ma/news','127.0.0.1','内网IP','{\"nid\":5,\"nread\":\"1\",\"params\":{},\"updateBy\":\"admin\",\"updateTime\":\"2023-01-28 18:23:17.208\"}','{\"msg\":\"操作成功\",\"code\":200}',0,NULL,'2023-01-28 18:23:17'),(451,'新闻列',2,'com.ruoyi.material.controller.MaNewsController.edit()','PUT',1,'admin',NULL,'/ma/news','127.0.0.1','内网IP','{\"nid\":5,\"nread\":\"1\",\"params\":{},\"updateBy\":\"admin\",\"updateTime\":\"2023-01-28 18:23:26.683\"}','{\"msg\":\"操作成功\",\"code\":200}',0,NULL,'2023-01-28 18:23:26'),(452,'新闻列',2,'com.ruoyi.material.controller.MaNewsController.edit()','PUT',1,'admin',NULL,'/ma/news','127.0.0.1','内网IP','{\"nid\":4,\"nread\":\"1\",\"params\":{},\"updateBy\":\"admin\",\"updateTime\":\"2023-01-28 18:23:30.194\"}','{\"msg\":\"操作成功\",\"code\":200}',0,NULL,'2023-01-28 18:23:30'),(453,'新闻列',2,'com.ruoyi.material.controller.MaNewsController.edit()','PUT',1,'admin',NULL,'/ma/news','127