m.ruoyi.system.controller.MaCarouselimgController.imgupload()','POST',1,'maadmin',NULL,'/ma/carouselimg/imgupload','127.0.0.1','内网IP','','{\"msg\":\"操作成功\",\"code\":200}',0,NULL,'2023-01-28 20:36:38'),(526,'新闻列',2,'com.ruoyi.material.controller.MaNewsController.edit()','PUT',1,'maadmin',NULL,'/ma/news','127.0.0.1','内网IP','{\"author\":\"国家减灾网\",\"createBy\":\"admin\",\"createTime\":\"2023-01-28 18:22:29\",\"ndetail\":\"<p class=\\\"ql-align-justify\\\">\\t连日来，国家减灾中心党委采取党委（扩大）会、党支部和党小组集中学习等方式，组织学习党的二十大精神，研究贯彻落实措施，迅速掀起学习贯彻党的二十大精神热潮。</p><p class=\\\"ql-align-justify\\\">\\t根据减灾中心党委要求，10月16日减灾中心全体党员和干部职工通过电视、网络等方式，收听收看大会盛况。10月25日、28日、31日，减灾中心党委集中组织召开党委（扩大）会，传达学习党的二十大和二十届一中全会精神，研究贯彻落实工作方案，审议通过《减灾中心党委学习贯彻落实党的二十大精神工作方案》。</p><p class=\\\"ql-align-justify\\\">\\t减灾中心党委强调，学习宣传贯彻党的二十大精神是当前和今后一个时期的首要政治任务。<strong>要</strong>把学习贯彻党的二十大精神同学习党的十八大、十九大报告及习近平总书记系列讲话结合起来，同习近平总书记授旗致训词四周年集中学习宣贯活动结合起来，同习近平总书记关于应急管理和防灾减灾救灾重要论述结合起来，同谋划下一步重点工作结合起来，坚定不移把党的二十大提出的目标任务落到实处；<strong>要</strong>充分发挥党委理论学习中心组示范带动作用，党员领导干部带头领学促学，讲体会、谈感受，全体党员干部全面、系统、深入学；<strong>要</strong>创新学习形式，采取专家解读、主题党日、学习研讨和经验交流等灵活多样的形式，营造浓厚的学习氛围，确保覆盖到每个党支部、每个党小组、每名党员干部职工；<strong>要</strong>坚持学以致用，深入领会国家应急管理体系、完善风险监测预警体系、推动公共安全治理模式向事前预防转型、提高防灾减灾救灾和重大突发公共事件处置保障能力的重要意义，结合减灾中心业务工作实际加快推进 “两中心一库”建设。</p><p class=\\\"ql-align-justify\\\">\\t各党支部、党小组组织党员干部积极开展集中学习，结合工作实际谈认识谈思考，讨论研究如何将大会确定的重要思想、重要观点、重大判断、重大部署在应急管理和防灾减灾救灾领域具体化、实践化，不断提升防灾减灾救灾处置和技术服务保障能力。党员干部纷纷表示，作为一名应急领域的防灾减灾人，要把学习成果转化为干事创业、艰苦奋斗的强大动力，坚决扛起防范化解重大安全风险的政治责任，自信自强、守正创新，踔厉奋发、勇毅前行，为应急管理和防灾减灾救灾事业高质量发展贡献力量。</p><p><br></p>\",\"nid\":4,\"nread\":\"1\",\"ntitle\":\"国家减灾中心全面掀起学习贯彻 党的二十大精神热潮\",\"params\":{},\"updateBy\":\"maadmin\",\"updateTime\":\"2023-01-28 20:37:22.694\"}','{\"msg\":\"操作成功\",\"code\":200}',0,NULL,'2023-01-28 20:37:22'),(527,'角色管理',2,'com.ruoyi.web.controller.system.SysRoleController.edit()','PUT',1,'admin',NULL,'/system/role','127.0.0.1','内网IP','{\"admin\":false,\"createTime\":\"2023-01-17 13:13:12\",\"dataScope\":\"1\",\"delFlag\":\"0\",\"deptCheckStrictly\":true,\"flag\"